function play(type, frequency, duration, volume){
    type = type || 'sine';
    duration = duration || 100;
    frequency = frequency || 440;
    volume = volume || 100;

    const oscillatorNode = audioContext.createOscillator();
    const gainNode = audioContext.createGain();
    oscillatorNode.connect(gainNode);
    gainNode.connect(audioContext.destination);
    gainNode.gain.value = volume * 0.01;
    oscillatorNode.frequency.value = frequency;
    oscillatorNode.type= type;
    oscillatorNode.start(audioContext.currentTime);
    oscillatorNode.stop(audioContext.currentTime + duration * 0.001);
}

function warn() {
    play('sawtooth', 600, 80);
    setTimeout(function() {
        play('sawtooth', 500, 50);
    }, 80);
}

function beep() {
    play('sawtooth', 440);
}

function tada() {
    play('triangle', 200, 60);
    setTimeout(function() {
        play('triangle', 340, 70);
    }, 60);
    setTimeout(function() {
        play('triangle', 480, 80);
    }, 130);
    setTimeout(function() {
        play('triangle', 530, 180);
    }, 210);
}

const wavUri = {
    win: "data:audio/wav;base64,",

    sad: "data:audio/wav;base64,"
};

function playWav(id) {
    if (!['win', 'sad'].includes(id)) {
        id = 'sad';
    }
    const sound = new Audio(wavUri[id])
    sound.play();
}
